import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element and click to open the cart
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the cart items to load
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    // Click the remove button for the first item in the cart
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.click('.remove-item');

    // Take a screenshot after removing the item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_removed.png'));

    // Verify the cart is updated
    const cartItems = await page.$$('.cart-item');
    const itemCount = cartItems.length;

    return {
      success: true,
      action: "Removed an item from the cart",
      extractedData: { itemCount },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
